import React, { useEffect, useState } from 'react';
import api from './services/api';

interface IUser {
  name: string,
  email: string
}




function App() {
  const [users, setUsers] = useState<IUser[]>([]);
useEffect(()=>{

  api.get<IUser[]>('/users').then(response => {
      setUsers(response.data);
  })
},[])
  return (
    <div className="App">
     {users.map(user => <p>{user.name} - {user.email} </p>)}
    </div>
  );

}

export default App;
